import React from 'react'
import { fname,lname } from '../App'
export const ComC = () => {
  return (
    <>
    <fname.Consumer> 
   {(fname)=>{
    return(
      <lname.Consumer>
        {(lname)=>{
          return(
            <h1>My name is {fname} {lname}</h1>
          )
        }}
      </lname.Consumer>
    )
   }}
    </fname.Consumer>
   </>
  )
}
